import java.sql.Timestamp;
// Parse String into Uber case class
def ParseUber(str:String) : Uber = {

    val p = str.split(',')
    val x = p(0).substring(1, p(0).length()-1).split(' ')
    val old_date_format = x(0).split('/')
    val date = old_date_format(2)+"-"+old_date_format(0)+"-"+old_date_format(1)
    val ts =   date+" "+ x(1)
    Uber(Timestamp.valueOf(ts),p(1).toDouble,p(2).toDouble,p(3))

}

